import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class Website extends React.Component{
  render(){
      return(
        <div>
          <div className="row_1">
            {this.renderSquare(0)}
            {this.renderSquare(1)}
            {this.renderSquare(2)}
          </div>
          <div className="row_2">
            {this.renderSquare(3)}
            {this.renderSquare(4)}
            {this.renderSquare(5)}
          </div>
          <div className="row_3">
            {this.renderSquare(6)}
            {this.renderSquare(7)}
            {this.renderSquare(8)}
          </div>
          <Reset onClick={()=>{this.handleReset()}}/>
        </div>
      )
    }
  }
ReactDOM.render(
    <Board />,
  document.getElementById('root')
);

